/**
 * @param {number[]} nums
 * @param {number} modulo
 * @param {number} k
 * @return {number}
 */
var countInterestingSubarrays = function(nums, modulo, k) {
    let count = 0;
    const prefixCount = new Map([[0, 1]]);
    let currentSum = 0, currentMod = 0;

    for (let num of nums) {
        if (num % modulo === k) currentSum++;
        currentMod = ((currentSum - k) % modulo + modulo) % modulo;
        count += prefixCount.get(currentMod) || 0;
        prefixCount.set(currentSum % modulo, (prefixCount.get(currentSum % modulo) || 0) + 1);
    }

    return count;
};
